import React from 'react';
import { FaLinkedin, FaTwitter, FaBookmark, FaClipboard, FaEnvelope } from 'react-icons/fa';
import './SocialDock.css';

const SocialDock = () => {
  return (
    <div className="social-dock">
      <a href="https://linkedin.com/in/yourprofile" target="_blank" rel="noopener noreferrer"><FaLinkedin /></a>
      <a href="https://twitter.com/yourprofile" target="_blank" rel="noopener noreferrer"><FaTwitter /></a>
      <a href="#bookmark"><FaBookmark /></a>
      <a href="#clipboard"><FaClipboard /></a>
      <a href="mailto:your.email@example.com"><FaEnvelope /></a>
    </div>
  );
};

export default SocialDock;
